import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

import "../pages/Projects.scss"


function Projects(){


    class VerticalMouseDrivenCarousel {
        constructor(options = {}) {
            const _defaults = {
                carousel: ".js-carousel",
                bgImg: ".js-carousel-bg-img",
                list: ".js-carousel-list",
                listItem: ".js-carousel-list-item"
            };

            this.posY = 0;

            this.defaults = Object.assign({}, _defaults, options);

            this.initCursor();
            this.init();
            this.bgImgController();
        }

        //region getters
        getBgImgs() {
            return document.querySelectorAll(this.defaults.bgImg);
        }

        getListItems() {
            return document.querySelectorAll(this.defaults.listItem);
        }

        getList() {
            return document.querySelector(this.defaults.list);
        }

        getCarousel() {
            return document.querySelector(this.defaults.carousel);
        }

        init() {
            TweenMax.set(this.getBgImgs(), {
                autoAlpha: 0,
                scale: 1.05
            });

            TweenMax.set(this.getBgImgs()[0], {
                autoAlpha: 1,
                scale: 1
            });

            this.listItems = this.getListItems().length - 1;

            this.listOpacityController(0);
        }

        initCursor() {
            const listHeight = this.getList().clientHeight;
            const carouselHeight = this.getCarousel().clientHeight;

            this.getCarousel().addEventListener(
                "mousemove",
                event => {
                    this.posY = event.pageY - this.getCarousel().offsetTop;
                    let offset = -this.posY / carouselHeight * listHeight;

                    TweenMax.to(this.getList(), 0.3, {
                        y: offset,
                        ease: Power4.easeOut
                    });
                },
                false
            );
        }

        bgImgController() {
            for (const link of this.getListItems()) {
                link.addEventListener("mouseenter", ev => {
                    let currentId = ev.currentTarget.dataset.itemId;

                    this.listOpacityController(currentId);

                    TweenMax.to(ev.currentTarget, 0.3, {
                        autoAlpha: 1
                    });

                    TweenMax.to(".is-visible", 0.2, {
                        autoAlpha: 0,
                        scale: 1.05
                    });

                    if (!this.getBgImgs()[currentId].classList.contains("is-visible")) {
                        this.getBgImgs()[currentId].classList.add("is-visible");
                    }

                    TweenMax.to(this.getBgImgs()[currentId], 0.6, {
                        autoAlpha: 1,
                        scale: 1
                    });
                });
            }
        }

        listOpacityController(id) {
            id = parseInt(id);
            let aboveCurrent = this.listItems - id;
            let belowCurrent = parseInt(id);

            if (aboveCurrent > 0) {
                for (let i = 1; i <= aboveCurrent; i++) {
                    let opacity = 0.5 / i;
                    let offset = 5 * i;
                    TweenMax.to(this.getListItems()[id + i], 0.5, {
                        autoAlpha: opacity,
                        x: offset,
                        ease: Power3.easeOut
                    });
                }
            }

            if (belowCurrent > 0) {
                for (let i = 0; i <= belowCurrent; i++) {
                    let opacity = 0.5 / i;
                    let offset = 5 * i;
                    TweenMax.to(this.getListItems()[id - i], 0.5, {
                        autoAlpha: opacity,
                        x: offset,
                        ease: Power3.easeOut
                    });
                }
            }
        }
    }

    new VerticalMouseDrivenCarousel();






    return(
    <div class="container">
	<header class="c-header c-header--archive c-header--project-list">
		<div class="c-mouse-vertical-carousel js-carousel u-media-wrapper u-media-wrapper--16-9">
			<ul class="c-mouse-vertical-carousel__list js-carousel-list">
				<li class="c-mouse-vertical-carousel__list-item js-carousel-list-item" data-item-id="0">
					<Link href="">
						<p class="c-mouse-vertical-carousel__eyebrow u-b4">
							<span>
                        01
                    </span> Nevada
						</p>

						<p class="c-mouse-vertical-carousel__title u-a5">
							Carson City
						</p>
					</Link>
				</li>

				<li class="c-mouse-vertical-carousel__list-item js-carousel-list-item" data-item-id="1">
					<Link href="">
						<p class="c-mouse-vertical-carousel__eyebrow u-b4">
							<span>
                        02
                    </span> New Hampshire
						</p>

						<p class="c-mouse-vertical-carousel__title u-a5">
							Concord
						</p>
					</Link>
				</li>

				<li class="c-mouse-vertical-carousel__list-item js-carousel-list-item" data-item-id="2">
					<Link href="">
						<p class="c-mouse-vertical-carousel__eyebrow u-b4">
							<span>
                        03
                    </span> New York
						</p>

						<p class="c-mouse-vertical-carousel__title u-a5">
							Albany
						</p>
					</Link>
				</li>

				<li class="c-mouse-vertical-carousel__list-item js-carousel-list-item" data-item-id="3">
					<Link href="">
						<p class="c-mouse-vertical-carousel__eyebrow u-b4">
							<span>
                        04
                    </span> Oklahoma
						</p>

						<p class="c-mouse-vertical-carousel__title u-a5">
							Oklahoma City
						</p>
					</Link>
				</li>

				<li class="c-mouse-vertical-carousel__list-item js-carousel-list-item" data-item-id="4">
					<Link href="">
						<p class="c-mouse-vertical-carousel__eyebrow u-b4">
							<span>
                        05
                    </span> North Carolina
						</p>

						<p class="c-mouse-vertical-carousel__title u-a5">
							Raleigh
						</p>
					</Link>
				</li>

				<li class="c-mouse-vertical-carousel__list-item js-carousel-list-item" data-item-id="5">
					<Link href="">
						<p class="c-mouse-vertical-carousel__eyebrow u-b4">
							<span>
                        06
                    </span> Utah
						</p>

						<p class="c-mouse-vertical-carousel__title u-a5">
							Salt Lake City
						</p>
					</Link>
				</li>

				<li class="c-mouse-vertical-carousel__list-item js-carousel-list-item" data-item-id="6">
					<Link href="">
						<p class="c-mouse-vertical-carousel__eyebrow u-b4">
							<span>
                        07
                    </span> Missouri
						</p>

						<p class="c-mouse-vertical-carousel__title u-a5">
							Jefferson City
						</p>
					</Link>
				</li>
			</ul>

			<div class="c-mouse-vertical-carousel__bg-img js-carousel-bg-img" style="background-image: url('https://d39d4r6jmh1lz3.cloudfront.net/lass-id-original-1515801602-5a594c029dcd1.jpg')"></div>
